/**
 * Create new elements through drag and drop.
 *
 */
export default class Create {
    static $inject: string[];
    /**
     * @param canvas
     * @param dragging
     * @param eventBus
     * @param modeling
     * @param rules
     */
    constructor(canvas: Canvas, dragging: Dragging, eventBus: EventBus, modeling: Modeling, rules: Rules);
    /**
     * @param event
     * @param elements
     * @param context
     */
    start: (event: any, elements: any, context?: any) => void;
}

type Element = import('diagram-js/lib/core/Types').ElementLike;
type Shape = import('diagram-js/lib/core/Types').ShapeLike;
type Point = import('diagram-js/lib/util/Types').Point;
type Canvas = import('diagram-js/lib/core/Canvas').default;
type Dragging = import('diagram-js/lib/features/dragging/Dragging').default;
type EventBus = import('diagram-js/lib/core/EventBus').default;
type Modeling = import('diagram-js/lib/features/modeling/Modeling').default;
type Rules = import('diagram-js/lib/features/rules/Rules').default;
